//# Get revision info for package pyparameterset; generated by CMake

#include <pyparameterset/Package__Version.h>
#include <Common/Version.h>
#include <pytools/Package__Version.h>

namespace LOFAR {
  Version pyparametersetVersion::getInfo()
  {
    return Version ("pyparameterset",
                    getVersion(), getConfVersion(),
                    getRevision(), getPackageRevision(),
                    getNrChangedFiles(),
                    getBuildTime(), getBuildUser(), getBuildMachine());
  }

  std::string pyparametersetVersion::getVersion()
    { return "CEP-Imager-Task5206"; }
  std::string pyparametersetVersion::getConfVersion()
    { return "1.0"; }
  std::string pyparametersetVersion::getRevision()
    { return "31269"; }
  std::string pyparametersetVersion::getPackageRevision()
    { return "29634"; }
  std::string pyparametersetVersion::getNrChangedFiles()
    { return "0"; }
  std::string pyparametersetVersion::getBuildTime()
  { return std::string(__DATE__) + " " + std::string(__TIME__); }
  std::string pyparametersetVersion::getBuildUser()
  { return "iniyan"; }
  std::string pyparametersetVersion::getBuildMachine()
  { return "pyimager.c.meerkat-7-gazing.internal"; }
  void pyparametersetVersion::fillInfo
    (int level, std::vector<Version::PkgInfo>& vec)
  {
    // Add info of this package if needed.
    vec.push_back (Version::PkgInfo(level, &getInfo));
    // Add info of packages being used.
    pytoolsVersion::fillInfo (level+1, vec);
  }
}
